    [],nt"num_tags": 4,nt"name": "monthly-narrative-reports-for-the-des-lacs-wildlife-refuge-1937",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Des Lacs and
    Lostwood Migratory Waterfowl Refuges outlines Refuge accomplishments from January
    through April of 1937. The report begins by summarizing the weather conditions during
    this period. Wildlife- including migratory birds, upland game birds, predators,
    and rodents- is also covered. The Refuge development and maintenance section discusses
    physical developments. Resource management is outlined; topics include grazing and
    haying. A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes hunting. N-R forms and photographs
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
